import styled from 'styled-components'

export const Row = styled.div`
  display: flex;

  background-color: #c3989833;
  padding: 19px 82px;
  margin: 21px 0;

  ul {
    list-style-type: none;
    margin-left: 20px;

    li {
      margin-top: 19px;
      display: flex;
      width: 300px;
      align-items: center;

      span {
        margin-left: 10px;
        width: 100%;
      }
    }
  }
`
